    dna_string = dataset[i + 1]
    dna_string_gc_content = calculate_gc_content(dna_string)
    if dna_string_gc_content > largest_gc_content:
        largest_gc_content = dna_string_gc_content
        largest_id = dataset[i].split(">")[1]

